import React from "react";
import classes from "./Header.module.css";
import { Link } from "react-router-dom";

class Header extends React.Component {
    render() {
        return (
        <header>
          <nav className={classes.header}>
            <Link to='/task1' className={classes.headerLink}>Task1</Link>
            <Link to='/task2' className={classes.headerLink}>Task2</Link>
            <Link to='/task3' className={classes.headerLink}>Task3</Link>
          </nav>
        </header>
        );
    }
}

export default Header;
